import React from 'react';
import TextBtn from './components/TextBtn';
import Background from '../../../images/bg.png';
import Typical from 'react-typical';

const PcWelcome = () => {
    return (
      <div style={{
        position: 'absolute',
        top: 0,
        left: 0,
        bottom: 0,
        right: 0,
        // backgroundImage: `url(${Background})`,
        backgroundPosition: 'center',
        backgroundSize: 'cover',
        backgroundRepeat: 'no-repeat'
      }}>
            <div style={{
                width: '40%',
                height: '5%',
                position: 'absolute',
                right: '8%',
                textAlign:'right',
                fontFamily: "NanumPen",
                fontWeight: 'bold',
                fontSize: '500%',
                color: '#FFC300'
            }}>
                <p>Jay Kwon</p>
            </div>
            <div style={{
                width: '40%',
                height: '10%',
                position: 'absolute',
                top: '13%',
                right: '8%',
                textAlign:'right',
                fontFamily: "NanumPen",
                fontSize: '300%',
                color: '##FFC300'
            }}>
                <Typical
                    steps={['Welcome to ', 500, "Welcome to Jay Kwon's Webpage!", 2000]}
                    loop={Infinity}
                    wrapper="p"
                />
            </div>
            <div style={{
                width: '19%',
                // height: '30%',
                position: 'absolute',
                top: '25%',
                right: '8%'
            }}>
                <TextBtn></TextBtn>

            </div>
        </div>
    );
};

export default PcWelcome;
